import React from "react";
import Wallpaper from "../commonwallpaper/Wallpaper";
import Footer from "../sign-In/Footer";
import netflixlogo from "../../assets/netflix-logos-idcIWizlPG.png"
import Dropdown from "../commonwallpaper/Dropdown";

function SignUp() {
  return  <div
  className=" absolute bg-black bg-opacity-100 overflow-hidden"
  style={{ backgroundColor: "#000" }}
>
  <div className="logo-container">
    <img
      class="h-auto max-w-xs"
      className="img-logo"
      src={netflixlogo}
      alt="netflix-logo"
      style={{ color: "red" }}
    />
    <span className=""> <Dropdown/> </span>
  </div>
  <div>
    {" "}
    <Wallpaper />
  </div>
  <div>
    {" "}
    <Footer />
  </div>
</div>
}

export default SignUp;
